//http://stamat.wordpress.com/2013/07/03/javascript-object-ordered-property-stringify/
//SORT WITH STRINGIFICATION
var orderedStringify = function (o, fn) {
	var props = [];
    var res = '{';
	for(var i in o) {
		props.push(i);
	}
	props = props.sort(fn);
	
	for(var i = 0; i < props.length; i++) {
		var val = o[props[i]];
		var type = types[whatis(val)];
		if(type === 3) {
			val = orderedStringify(val, fn);
        } else if(type === 2) {
        	val = arrayStringify(val, fn);
        } else if(type === 1) {
        	val = '"'+val+'"';
        }
        
        if(type !== 4)
        	res += '\n"'+props[i]+'":'+ val+',';
	}
	
    return res.substring(res, res.lastIndexOf(','))+'}';
};

//orderedStringify for array containing objects
var arrayStringify = function(a, fn) {
	var res = '[';
	for(var i = 0; i < a.length; i++) {
		var val = a[i];
		var type = types[whatis(val)];
		if(type === 3) {
			val = orderedStringify(val, fn);
        } else if(type === 2) {
        	val = arrayStringify(val);
        } else if(type === 1) {
        	val = '"'+val+'"';
        }
        
        if(type !== 4)
        	res += ''+ val+',';
	}
	
	return res.substring(res, res.lastIndexOf(','))+']';
}

//SORT WITHOUT STRINGIFICATION

var sortProperties = function(o, fn) {
	var props = [];
	var res = {};
	for(var i in o) {
		props.push(i);
	}
	props = props.sort(fn);
	
	for(var i = 0; i < props.length; i++) {
		var val = o[props[i]];
		var type = types[whatis(val)];
		
		if(type === 3) {
			val = sortProperties(val, fn);
        } else if(type === 2) {
        	val = sortProperiesInArray(val, fn);
        } 
		res[props[i]] = val;
	}
	
	return res;
};

//sortProperties for array containing objects
var sortProperiesInArray = function(a, fn) {
	for(var i = 0; i < a.length; i++) {
		var val = a[i];
		var type = types[whatis(val)];
		if(type === 3) {
			val = sortProperties(val, fn);
        } else if(type === 2) {
        	val = sortProperiesInArray(val, fn);
        }
        a[i] = val;
	}
	
	return a;
}

//HELPER FUNCTIONS

var types = {
	'integer': 0,
	'float': 0,
	'string': 1,
	'array': 2,
	'object': 3,
	'function': 4,
	'regexp': 5,
	'date': 6,
	'null': 7,
	'undefined': 8,
	'boolean': 9
}

var getClass = function(val) {
	return Object.prototype.toString.call(val)
		.match(/^\[object\s(.*)\]$/)[1];
};

var whatis = function(val) {

	if (val === undefined)
		return 'undefined';
	if (val === null)
		return 'null';
		
	var type = typeof val;
	
	if (type === 'object')
		type = getClass(val).toLowerCase();
	
	if (type === 'number') {
		if (val.toString().indexOf('.') > 0)
			return 'float';
		else
			return 'integer';
	}
	
	return type;
};


